import React from 'react';

//const KEY = 'AIzaSyBdXjGbMZ7Yd_W3digAhPLAjnKWACgL5Us';

class Search extends React.Component{
    constructor(){
        super()
        this.state = {
            search:'',
            abc : ''
        }
    }

    handleChange = (e) => {
        this.setState({[e.target.name]: e.target.value});
    }

    render(){
        return(
            <div>
                <input type='text' name='search' placeholder='Search here' value={this.state.Search} onChange={this.handleChange} />
                <input type='text' name='abc' placeholder='here' value={this.state.abc} onChange={this.handleChange} />

            </div>
        )
    }

}

export default Search;
